-- ----------------------------
--  Table structure for `pic_log`
-- ----------------------------
DROP TABLE IF EXISTS `pic_log`;
CREATE TABLE `pic_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录id',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `created_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  `updated_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `application_no` varchar(32) DEFAULT NULL COMMENT '申请编号 ',
  `pic_url` varchar(1024) DEFAULT NULL COMMENT '图片地址',
  `file_type` int(1) DEFAULT NULL COMMENT '文件类别 只有合同需要使用 0 购销合同 1 租赁合同 2 咨询协议',
  `pic_name` varchar(256) DEFAULT NULL COMMENT '图片名字 同一个订单名字唯一',
  `up_pic_time` datetime DEFAULT NULL COMMENT '上传图片时间',
  `is_delete` bit(1) DEFAULT NULL COMMENT '是否删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1379 DEFAULT CHARSET=utf8 COMMENT='图片记录表';

