  `pass_is_update` bit(1) DEFAULT NULL COMMENT '密码是否修改',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `index_name` (`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=222 DEFAULT CHARSET=utf8 COMMENT='后台运营用户登录表';

